import React from "react";
import taste from '../Lists/sweetcards.module.css';
import { FaRegHeart } from "react-icons/fa";
function Sweets() {
    const SweetDetails = [
        {
            name: "Rasmalai",
            cost: 500,
            rating: 5,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Gulab Jamun",
            cost: 350,
            rating: 5,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Rasgolla",
            cost: 280,
            rating: 4,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Puthrekhu",
            cost: 280,
            rating: 4,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Kalakand",
            cost: 530,
            rating: 4,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Kaju Bharfi",
            cost: 230,
            rating: 5,
            imageUrl: "data:image/jpeg;base64,"
        },
        
        {
            name: "Ladoo",
            cost: 150,
            rating: 5,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Jalebi",
            cost: 200,
            rating: 4,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Sandesh",
            cost: 180,
            rating: 4,
            imageUrl: "data:image/jpeg;base64,"
        },
        {
            name: "Halwa",
            cost: 300,
            rating: 5,
            imageUrl: "data:image/jpeg;base64,"
        }
        
    ];

    return (
        <>
            <div className={taste.container}>
                {
                    SweetDetails.map((sweet, ind) => {
                        return (
                            <div className={taste.card}>
                                <div className={taste.likeButton}><FaRegHeart /></div>
                                <img src={sweet.imageUrl} className={taste.sweetImage} />
                                <div className={taste.sweetName}>Name: {sweet.name}</div>
                                <div className={taste.sweetCost}>Cost: {sweet.cost}</div>
                                <div className={taste.sweetRating}>Rating: {sweet.rating}</div>
                                <div className={taste.cartButton}>Add to Cart</div>
                            </div>
                        );
                    })
                }
            </div>
        </>
    );
}

export default Sweets;
